import { styled } from "@mui/material/styles";

const MuiChipCustom = styled(Chip)(() => ({
    backgroundColor: 'lightblue',
    borderRadius: 25,
    color: 'white',  
    margin: 14, 

    '& .MuiChip-label': {
       color: 'blue', //using the MUI chip label properties
       fontSize: 16
    },

    '& .MuiChip-deleteIcon': {
       color: 'blue',
       fontSize: 16
    },
 }));

 export default MuiChipCustom;
